import { useMemo, useState, useCallback } from 'react';
import { Button, Layout, Menu, MenuItemProps, Statistic } from 'antd';
import { Link } from 'react-router-dom';
import './Home.css';
const { Header, Content, Footer } = Layout;

const Home = () => {
  const [page, setPages] = useState(1);
  const memoForMenu = {
    1: <div>Home page</div>,
    2: <div>Static page</div>,
    3: <div>contact page</div>,
  };

  const returnCurrentPage = useMemo(() => {
    if (page === 1) {
      return <div>Home page</div>;
    } else if (page === 2) {
      return <div>Static page</div>;
    } else {
      <div>contact page</div>;
    }
  }, [page]);
  const handlePageChange = (menuKey: string) => {
    console.log(menuKey);
    return setPages(Number(menuKey));
  };
  return (
    <Layout className="App">
      <Header style={{ position: 'fixed', zIndex: 1, width: '100%' }}>
        <div className="logo" />
        <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
          <Menu.Item key="1" onClick={(menu) => handlePageChange(menu.key)}>
            Home
          </Menu.Item>
          <Menu.Item key="2" onClick={(menu) => handlePageChange(menu.key)}>
            Static
          </Menu.Item>
          <Menu.Item key="3" onClick={(menu) => handlePageChange(menu.key)}>
            Contact
          </Menu.Item>
        </Menu>
      </Header>
      <Content
        className="site-layout"
        style={{ padding: '0 50px', marginTop: 64 }}
      >
        <div
          className="site-layout-background"
          style={{ padding: 24, minHeight: 380 }}
        >
          <>{memoForMenu[3]}</>
        </div>
      </Content>
      <Footer style={{ textAlign: 'center' }}>
        Ant Design Â©2018 Created by Ant UED
      </Footer>
    </Layout>
  );
};
export default Home;
